pair<int, int> deter(vector<int> ans, vector<int> input)
{
     /*
     æ¥æ”¶vector<int>å‹æ…‹åˆ¥çš„è®Šæ•¸ä»£è¡¨ç­”æ¡ˆ
     å’Œæ¥æ”¶vector<int>å‹æ…‹åˆ¥çš„è®Šæ•¸ä»£è¡¨è¼¸å…¥æ•¸åˆ—

     è™•ç†ç­”æ¡ˆå’Œç”Ÿæˆæ•¸åˆ—æ¯”å°ï¼Œä¸¦è¼¸å‡ºå¹¾Aå¹¾B
     
     å›å‚³å€¼å‹æ…‹åˆ¥ç‚ºboolä»£è¡¨æ˜¯å¦çŒœå°
     */
     int n=ans.size();
     int A=0,B=0;
     for(int i=0;i<n;i++)
     {
          if(ans[i]==input[i])
          {
               A++;
          }
          else
          {
               for(int count=0;count<n;count++)
               {
                    if(input[i]==ans[count])
                    {
                         B++;
                         break;
                    }
               }
          }
     }
     
     return make_pair(A,B);
}

