void sqrt_main() {
  // c ÑÑ‚Ğ¾ Ğ¸ ĞºĞ¾Ğ»Ğ¸Ñ‡ĞµÑÑ‚Ğ²Ğ¾ Ğ±Ğ»Ğ¾ĞºĞ¾Ğ², Ğ¸ Ñ‚Ğ°ĞºĞ¶Ğµ Ğ¸Ñ… Ñ€Ğ°Ğ·Ğ¼ĞµÑ€; Ğ¾Ğ½Ğ¾ Ğ´Ğ¾Ğ»Ğ¶Ğ½Ğ¾ Ğ±Ñ‹Ñ‚ÑŒ Ñ‡ÑƒÑ‚ÑŒ Ğ±Ğ¾Ğ»ÑŒÑˆĞµ
  // ĞºĞ¾Ñ€Ğ½Ñ
  const int maxn = 1e5, c = 330;
  int a[maxn], b[c], add[c];

  for (int i = 0; i < n; i++)
    b[i / c] += a[i];
}

int sum(int l, int r) {
  int res = 0;
  while (l <= r) {
    // ĞµÑĞ»Ğ¸ Ğ¼Ñ‹ Ğ½Ğ°Ñ…Ğ¾Ğ´Ğ¸Ğ¼ÑÑ Ğ² Ğ½Ğ°Ñ‡Ğ°Ğ»Ğµ Ğ±Ğ»Ğ¾ĞºĞ° Ğ¸ Ğ¾Ğ½ Ñ†ĞµĞ»Ğ¸ĞºĞ¾Ğ¼ Ğ² Ğ·Ğ°Ğ¿Ñ€Ğ¾ÑĞµ
    if (l % c == 0 && l + c - 1 <= r) {
      res += b[l / c];
      l += c; // Ğ¼Ñ‹ Ğ¼Ğ¾Ğ¶ĞµĞ¼ Ğ¿Ñ€Ñ‹Ğ³Ğ½ÑƒÑ‚ÑŒ ÑÑ€Ğ°Ğ·Ñƒ Ğ½Ğ° Ğ±Ğ»Ğ¾Ğº
    } else {
      res += a[l] + add[l / c];
      l += 1;
    }
  }
  return res;
}

void upd(int l, int r, int x) {
  while (l <= r) {
    if (l % c == 0 && l + c - 1 <= r) {
      b[l / c] += c * x;
      add[l / c] += x;
      l += c;
    } else {
      b[l / c] += x;
      a[l] += x;
      l++;
    }
  }
}
