// Ğ¿Ñ€Ğ¾Ğ²ĞµÑ€ÑĞµÑ‚, ÑĞ²Ğ»ÑĞµÑ‚ÑÑ Ğ»Ğ¸ Ñ‚ĞµĞºÑƒÑ‰ĞµĞµ Ñ‡Ğ¸ÑĞ»Ğ¾ Ğ½ĞµÑ‡ĞµÑ‚Ğ½Ñ‹Ğ¼
bool big_integer::odd() const {
    if (this->_digits.size() == 0) return false;
    return this->_digits[0] & 1;
}
 
// Ğ¿Ñ€Ğ¾Ğ²ĞµÑ€ÑĞµÑ‚, ÑĞ²Ğ»ÑĞµÑ‚ÑÑ Ğ»Ğ¸ Ñ‚ĞµĞºÑƒÑ‰ĞµĞµ Ñ‡Ğ¸ÑĞ»Ğ¾ Ñ‡ĞµÑ‚Ğ½Ñ‹Ğ¼
bool big_integer::even() const {
    return !this->odd();
}
 
// Ğ²Ğ¾Ğ·Ğ²Ğ¾Ğ´Ğ¸Ñ‚ Ñ‚ĞµĞºÑƒÑ‰ĞµĞµ Ñ‡Ğ¸ÑĞ»Ğ¾ Ğ² ÑƒĞºĞ°Ğ·Ğ°Ğ½Ğ½ÑƒÑ ÑÑ‚ĞµĞ¿ĞµĞ½ÑŒ
const big_integer big_integer::pow(big_integer n) const {
    big_integer a(*this), result(1);
    while (n != 0) {
        if (n.odd()) result *= a;
        a *= a;
        n /= 2;
    }
 
    return result;
}
