/// CountDivs ///
vector<int> divs;
int countDivs(int n) {
  int cnt = 2;
  divs.push_back(1);
  divs.push_back(n);
  for (int i = 2; i * i <= n; i++) {
    if (n % i == 0) {
      cnt += 2;
      divs.push_back(i);
      divs.push_back(n / i);
      if (i * i == n) {
        cnt--;
        divs.pop_back();
      }
    }
  }
  return cnt;
}
/// BinPow ///
ll binPow(ll x, ll n) {
  if (n == 0) {
    return 1;
  }
  if (n % 2 == 0) {
    ll a = binPow(x, n / 2);
    return a * a;
  } else {
    ll a = binPow(x, n - 1);
    return x * a;
  }
}
/// Extended Euclid algorithm ///
int gcdExtended(int a, int b, int *x, int *y) {
  if (a == 0) {
    *x = 0;
    *y = 1;
    return b;
  }
  int x1, y1;
  int gcd = gcdExtended(b % a, a, &x1, &y1);
  *x = y1 - (b / a) * x1;
  *y = x1;
  return gcd;
}
/// dijstra ///
void dijkstra(ll s) {
  dist[s] = 0;
  set<pair<ll, ll>> q;
  q.emplace(dist[s], s);
  while (!q.empty()) {
    ll v = q.begin()->second;
    q.erase(q.begin());
    for (int i = 0; i < g[v].size(); ++i) {
      ll u = g[v][i].second;
      ll len = g[v][i].first;
      if (dist[u] < dist[v] + len) {
        q.erase({dist[u], u});
        dist[u] = dist[v] + len;
        q.emplace(dist[u], u);
      }
    }
  }
}
