/// segtree ///
struct segtree {
  struct node {
    int x;
  };

  vector<node> tree;
  int size;

  const node ZERO = {0};
  node one_element(int a) { return {a}; }

  node combine(node a, node b) { return {a.x + b.x}; }

  void init(int n) {
    size = 1;
    while (size < n)
      size *= 2;
    tree.assign(2 * size - 1, ZERO);
  }

  void build(vector<int> &q, int x, int lx, int rx) {
    if (rx - lx == 1) {
      if (lx < q.size()) {
        tree[x] = node({1});
      }
      return;
    }
    int m = lx + (rx - lx) / 2;
    build(q, 2 * x + 1, lx, m);
    build(q, 2 * x + 2, m, rx);
    tree[x] = combine(tree[2 * x + 1], tree[2 * x + 2]);
  }

  void build(vector<int> &q) {
    init(q.size());
    build(q, 0, 0, size);
  }

  void set(int i, int v, int x, int lx, int rx) {
    if (rx - lx == 1) {
      tree[x] = node({v});
      return;
    }
    int m = lx + (rx - lx) / 2;
    if (i < m)
      set(i, v, 2 * x + 1, lx, m);
    else
      set(i, v, 2 * x + 2, m, rx);
    tree[x] = combine(tree[2 * x + 1], tree[2 * x + 2]);
  }

  void set(int i, int v) { set(i, v, 0, 0, size); }

  int calc(int l, int r, int x, int lx, int rx) {
    if (lx >= r || rx <= l) {
      return 0;
    }
    if (lx >= l && rx <= r) {
      return tree[x].x;
    }
    int m = lx + (rx - lx) / 2;
    int s1 = calc(l, r, 2 * x + 1, lx, m);
    int s2 = calc(l, r, 2 * x + 2, m, rx);
    return s1 + s2;
  }

  int calc(int l, int r) { return calc(l, r, 0, 0, size); }
};

/// stack min ///
struct stack_min {
  vector<int> val;
  vector<int> val_min = {((ll)1e9)};

  void push(int v) {
    val.push_back(v);
    val_min.push_back(min(val_min.back(), v));
  }
  void pop() {
    val_min.pop_back();
    val.pop_back();
  }
  int get_min() { return val_min.back(); }
  int back() { return val.back(); }
};
/// queue min ///
struct queue_min {
  stack_min st1, st2;
  void push(int v) { st1.push(v); }
  void pop() {
    if (st2.val.size()) {
      st2.pop();
    } else {
      while (st1.val.size()) {
        st2.push(st1.back());
        st1.pop();
      }
      st2.pop();
    }
  }
  int get_min() { return min(st1.get_min(), st2.get_min()); }
};
/// next under
vector<int> next_under_right(vector<int> &q) {
  vector<int> st;
  vector<int> ans(q.size());
  for (int i = 0; i < q.size(); ++i) {
    while (st.size() && q[st.back()] > q[i]) {
      ans[st.back()] = i;
      st.pop_back();
    }
    st.push_back(i);
  }
  while (!st.empty()) {
    ans[st.back()] = q.size();
    st.pop_back();
  }
  return ans;
}
