int sum(int l, int r) {
  int res = 0;
  while (l <= r) {
    // ĞµÑĞ»Ğ¸ Ğ¼Ñ‹ Ğ½Ğ°Ñ…Ğ¾Ğ´Ğ¸Ğ¼ÑÑ Ğ² Ğ½Ğ°Ñ‡Ğ°Ğ»Ğµ Ğ±Ğ»Ğ¾ĞºĞ° Ğ¸ Ğ¾Ğ½ Ñ†ĞµĞ»Ğ¸ĞºĞ¾Ğ¼ Ğ² Ğ·Ğ°Ğ¿Ñ€Ğ¾ÑĞµ
    if (l % c == 0 && l + c - 1 <= r) {
      res += b[l / c];
