    } else {
      res += a[l] + add[l / c];
      l += 1;
    }
  }
  return res;
}

void upd(int l, int r, int x) {
  while (l <= r) {
    if (l % c == 0 && l + c - 1 <= r) {
      b[l / c] += c * x;
      add[l / c] += x;
      l += c;
    } else {
      b[l / c] += x;
      a[l] += x;
      l++;
    }
  }
}
