vector<string> reverse(vector<string> v){
    int n=v.size();
    if(n<=1)return v;
    vector<string> result, tmp;
    result.push_back(v[n-1]);
    v.pop_back();
    tmp = reverse(v);
    result.insert(result.end(), tmp.begin(), tmp.end());
    return result;
}
